import React from "react";
import chicago from './chicago.jpg'; // Tell webpack this JS file uses this image
import la from './la.jpg';
import ny from './ny.jpg';

function Carousel(){
  return(
    <div id="myCarousel" class="carousel slide" data-ride="carousel">
     {/* Indicators  */}
        <ul class="carousel-indicators">
            <li data-target="#myCarousel" data-slide-to="0" class="active"></li>
            <li data-target="#myCarousel" data-slide-to="1"></li>
            <li data-target="#myCarousel" data-slide-to="2"></li>
        </ul>
        {/* The slideshow  */}
    <div class="carousel-inner">
        <div class="carousel-item active">
        <img src={la} alt="Los Angeles" width="1100" height="500"/>
        </div>
        <div class="carousel-item">
        <img src={chicago} alt="Chicago" width="1100" height="500"/>
        </div>
        <div class="carousel-item">
        <img src={ny} alt="New York" width="1100" height="500"/>
        </div>
    </div>

    </div>
  );
}
export default Carousel;
